from api import app, uuid
from api.models import User, Category, Photo, Transaction, Cart, CartItem, db
from faker import Faker
import random, locale
from random import randint, choice as rc

fake = Faker()
with app.app_context():
    User.query.delete()
    Category.query.delete()
    Photo.query.delete()
    Transaction.query.delete()
    Cart.query.delete()
    CartItem.query.delete()

    users_images = [
        "https://cdn.pixabay.com/photo/2018/02/26/10/33/reflection-3182749_1280.jpg",
        "data:image/jpeg;base64,",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTW3ezJr6bZlw47wuPbj5IQlnIfe82lGFe8NQ&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJpgB08KAU4SLeaUQ7gbvLUAOOrdhxYZSiHw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrLiTaKWgm1UctxilnncHvgrAoOi5EJlgt7Q&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcST06rSPNF1dO4D4Sl-XBMJFDmaFxxKDpRucQ&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTmCS3T9TeGB7tY-U5ruUXnYqsVc8D6zX7STg&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSeXIYMTFSz0QrxXxbWhjWNFyrcjRBHaABcxA&usqp=CAU",
        "https://www.travelandleisure.com/thmb/SPUPzO88ZXq6P4Sm4mC5Xuinoik=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/eiffel-tower-paris-france-EIFFEL0217-6ccc3553e98946f18c893018d5b42bde.jpg",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZrCi8Bw8ebcj4Z7JADVwFoT7hzfQmA_rq3Q&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1aai4Ytj3qgu4SQs8qR1Loq5YTeItGT51Aw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSxujHYCz2Iy7itWQp0QuzF4l3QUDJbQqtNAw&usqp=CAU"
        "data:image/jpeg;base64,"
        "data:image/jpeg;base64,"
        "data:image/jpeg;base64,"
        "data:image/jpeg;base64,"
        "data:image/jpeg;base64,"
        "data:image/jpeg;base64,"
    ]

    categories = [
        'Animals',
        'Landscapes',
        'Food and Drink',
        'People and Portraits',
        'Travel and Tourism',
        'Sports and Athletics',
        'Fashion and Clothing',
        'Technology and Gadgets',
        'Nature and Wildlife',
        'Art and Creativity'
    ]

    print("🦸‍♀️ Seeding users...")
    user_ids = []
    for i in range(20):
        new_user = User(
            username=f'{fake.unique.first_name()}{fake.unique.last_name()}',
            profile_pic=f'/{rc(users_images)}',
            public_id = str(uuid.uuid4())

        )
        new_user.email = f'{new_user.username}@mail.com'
        db.session.add(new_user)
        db.session.commit()
        user_ids.append(new_user.id)

    print("🦸‍♀️ Seeding categories...")
    category_ids = []
    for i in range(len(categories)):
        new_category = Category(
            name=categories[i],
        )
        db.session.add(new_category)
        db.session.commit()
        category_ids.append(new_category.id)

    print("🦸‍♀️ Seeding photos...")
    photo_ids = []
    locale.setlocale(locale.LC_ALL, 'en_US.UTF-8')
    for i in range(len(users_images)):
        new_photo = Photo(
            name=fake.unique.word(),
            description=fake.unique.sentence(),
            price = round(random.uniform(1000.00, 10000.00), 2),
            user_id=rc(user_ids),
            category_id=rc(category_ids),
            image=rc(users_images)
        )
        db.session.add(new_photo)
        db.session.commit()
        photo_ids.append(new_photo.id)

    print("🦸‍♀️ Seeding carts, cart items, and transactions...")

    for _ in range(5):
        # Create a cart for a random user
        user_id = random.choice(user_ids)
        cart = Cart(user_id=user_id)
        db.session.add(cart)
        db.session.commit()

        for _ in range(5):
            while True:
                # Create a cart item for a random photo in the cart
                photo_id = random.choice(photo_ids)
                cart_item = CartItem(
                    cart=cart,
                    photo_id=photo_id,
                    quantity=random.randint(1, 5),
                )
                db.session.add(cart_item)
                db.session.commit()

                # Check if the user is trying to buy their own photo
                if Photo.query.get(photo_id).user_id == user_id:
                    print(f"User {user_id} tried to buy their own photo. Retrying...")
                    db.session.rollback()
                else:
                    break

            # Create a transaction for the cart item
            transaction = Transaction(
                cart_item=cart_item,
                user_id=user_id,
                photo_id=random.randint(1,12)
            )
            db.session.add(transaction)
            db.session.commit()
            print(f"Transaction successful: User {user_id} bought a photo.")

    print("🦸‍♀️ Seeding complete!")

    print("🦸‍♀️ Seeding complete!")


